import React, { useState } from "react";

const App = () => {
  const [click, setClick] = useState(0);
  const ButtonClickEvent = () => {
    setClick(click + 1);
  };
  useEffect(() => {
    <>
      <title>You Clicked {click}</title>
    </>;
  }, [click]);

  return <button onClick={ButtonClickEvent}>Click Me {click}</button>;
};

export default App;
